import './Footer.css';

export default function Footer() {
  return (
    <footer className="footer mt-auto py-3 bg-light">
      <div className="container text-center" style={{position: 'fixed', bottom: 0, textAlign:'center'}}>
        <span className="text-muted" >
          <p style={{ color: "#FD5F07" }}>&copy; {new Date().getFullYear()} Werty</p>
        </span>
      </div>
    </footer>
  );
}
